import React from 'react';
import "../App.css";
import BillView from '../components/BillView';


class Bill extends  React.Component{
      render()
    {
        return(
            <div style={mainStyle}>
                   <BillView/>
                </div>

        );
    }
}

const mainStyle={
    position:'fixed',
    backgroundColor:'LightGrey',
    width:"1390px",
    borderTopStyle:'none',
    border: '3px solid Black',
    height:"500px",
    top:'170px'
};

export default Bill;
